	return (
		<Switch>
			{isAuth === true && authRoutes.map(({path, Comonent}) =>
				<Route key={path} path={path} component={Component} exact />
			)}
			{publicRoutes.map(({path, Comonent}) =>
				<Route key={path} path={path} component={Component} exact />
			)}
		</Switch>
	);
};

